import React, {
    Component
} from 'react'
import axios from 'axios';

class Books extends Component {

    state = {
        books: []
    }

    componentDidMount() {
        axios.get('https://www.googleapis.com/books/v1/volumes?q=')
            .then(res => {
                const books = res.data
                this.setState({
                    books
                });
            })
    }
    render() {
            console.log(books);
            return ( <
                div >
                <
                ul > {
                    this.state.books.map(books => < li > {
                            books.volumeInfo.title
                        } < /li>)}</ul >
                        <
                        /div>
                    )
                }
            }

            export default Books;
